import * as React from 'react';
import CssBaseline from '@mui/material/CssBaseline';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import { display } from '@mui/system';
import './Signin.css'


function Signin() {
  const handleSubmit = (event) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
  
  };
  const BootstrapInput = styled(InputBase)(({ theme }) => ({
    'label + &': {
      marginTop: theme.spacing(3),
    },
    '& .MuiInputBase-input': {
      borderRadius: 5,
      position: 'relative',
      backgroundColor: theme.palette.mode === 'light' ? 'rgba(255, 255, 255, 0.341)' : '#2b2b2b',
      border: '1px solid rgb(153, 80, 180)',
      fontSize: 17,
      width: 'auto',
      padding: '10px 12px',
      transition: theme.transitions.create([
        'border-color',
        'background-color',
        'box-shadow',
      ]),
      // Use the system font instead of the default Roboto font.
      fontFamily: [
        '-apple-system',
        'BlinkMacSystemFont',
        '"Segoe UI"',
        'Roboto',
        '"Helvetica Neue"',
        'Arial',
        'sans-serif',
        '"Apple Color Emoji"',
        '"Segoe UI Emoji"',
        '"Segoe UI Symbol"',
      ].join(','),
      '&:focus': {
        boxShadow: '0px 0px 5px #b393d3, 0px 0px 10px #b393d3, 0px 0px 10px #b393d3, 0px 0px 20px #b393d3',
        borderColor:"purple",
      },
      
    },
  }));




  return (
    <Box className="boxx">
        <React.Fragment>
          <Container maxWidth="md" >
            <Box className="main" >
                <Box sx={{backgroundColor:"red"}} >
                        <Box ></Box>
                            <Box>
                                <h2>WELCOME BACK</h2>
                            </Box>
                    </Box>

                    <Box sx={{backgroundColor:"blue" ,width:"80vh"}} >
                    <FormControl variant="standard" sx={{margin:"0px"}}>
                                      <Box>
                                            <InputLabel shrink htmlFor="email-input" sx={{color:"gris",'&.Mui-focused': {color: "purple"}}}>
                                            Email
                                            </InputLabel>
                                             <BootstrapInput  id="email-input" />
                                        </Box>


                                      
                                          <Box>
                                              <InputLabel shrink  htmlFor="password-input" sx={{color:"gris" ,margin:"75px", marginLeft:"0px", '&.Mui-focused': {color: "purple"}}}>
                                               Password
                                              </InputLabel>
                                              <BootstrapInput  id="password-input"  />
                                          
                                          </Box>

                                  </FormControl>
                    </Box>





















            </Box>
          </Container>
        </React.Fragment>
        </Box>
      );
    
    

}

export default Signin;

